import logo from './logo.svg';
import './App.css';
import { useState } from 'react';

function App() {

  let [글제목, 글제목변경] = useState(['배우고 싶은 언어(기술)', '나의 소개'])


  return (
      <div className="App">

        <div className="pink">
          <h4>yealin</h4>
        </div>


          <button onClick={ ()=>{
            let copy = [...글제목];
            copy[0] = '포토샵, ';
            글제목변경(copy);
          } }>{글제목[0]}</button>
          <button onClick={ ()=>{
            let copy = [...글제목];
            copy[0] = '여자코트 추천';
            글제목변경(copy);
          } }>{글제목[1]}</button>

        <div className="list">
          <h4>{글제목[0]}</h4>
        </div>
        <div className="list">
          <h4>{글제목[1]}</h4>
        </div>


      </div>
  );
}

export default App;
